        visited[x][y] = True
        if wall_grid[x][y] == 'S':
            return 0
        elif wall_grid[x][y] == 'U':
            if dfs(x, y - 1) > 0:
                return 1
            else:
                return dfs(x, y + 1)
        elif wall_grid[x][y] == 'D':
            if dfs(x, y + 1) > 0:
                return 1
            else:
                return dfs(x, y - 1)
        elif wall_grid[x][y] == 'L':
            if dfs(x - 1, y) > 0:
                return 1
            else:
                return dfs(x + 1, y)
        elif wall_grid[x][y] == 'R':
            if dfs(x + 1, y) > 0:
                return 1
            else:
                return dfs(x - 1, y)
        else:
            return 0

    def min_zones(x, y):
        if not visited[x][y]:
            return dfs(x, y)
        else:
            return 0

    min_zones_list = []
    for i in range(N):
        for j in range(M):
            if not visited[i][j]:
                min_zones_list.append(min_zones(i, j))
